import React from 'react';
import { Link } from 'react-router-dom';

import './List.css';

const List = ({user}) => (
    <div className="usersList">
        <h3> Usu√°rio </h3>
        <p>{ user.name }</p><br />
        <h3> Email </h3>
        <p>{ user.email }</p>

        <div className="buttons">
            <Link to={"./details/"+user._id}><button className="btn btn-info">Visualizar</button></Link>
            <Link to={"./update/"+user._id}><button className="btn btn-warning">Editar</button> </Link>
            <Link to={"./delete/"+user._id}><button className="btn btn-danger">Deletar</button></Link>
        </div>
    </div>
);

export default List;
